import "./App.css";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import Nav from "./components/Nav/Nav";
import Home from "./components/Home/Home";
import CreateRecipe from "./components/RecipeCreator/RecipeCreator";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Nav />
        <Switch>
          <Route path="/home">
            <Home />
          </Route>
          <Route path="/create">
            <CreateRecipe />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
